import React, { useEffect, useState } from "react";
import './App.css';
import Snake from './components/snake/Snake'

function App() {
  const [game, setGame] = useState(null);

  return (
    <div className="App">
      <button onClick={setGame("snake")}>
        Play Snake
      </button>
      <button onClick={setGame("snake")}>
        Play Tic-Tac-Toe
      </button>
      <Snake />
    </div>
  );
}

export default App;
